import React from 'react'
import styled from 'styled-components';
import './WhoComponent.css';
import ParallaxImage from ''

const Section=styled.div`
height:100vh;
background-color:red;
scroll-snap-align:center;
`;




const WhoComponent = () => {

  const parallaxData = [
    {
      imageUrl: '../../../Assets/image1.jpg',
      parallaxSpeed: 1,
    },
    {
      imageUrl: '../../../Assets/image2.jpg',
      parallaxSpeed: 2,
    },
    {
      imageUrl: '../../../Assets/image3.jpg',
      parallaxSpeed: 3,
    },
    {
      imageUrl: '../../../Assets/image4.jpg',
      parallaxSpeed: 4,
    },
  ];
  return (
    <Section>
     <div className="parallax-container">
      {parallaxData.map((item, index) => (
        <ParallaxImage key={index} imageUrl={item.imageUrl} parallaxSpeed={item.parallaxSpeed} />
      ))}
    </div>
    </Section>
  )
}

export default WhoComponent
